import React, { useState } from 'react';

const AIGenerate = () => {
  const [exercises, setExercises] = useState([]);
  const [error, setError] = useState(null);

  const handleButtonClick = async () => {
    try {
      const apiResponse = await fetch('http://127.0.0.1:5000/api/AIGenerate'); // Update the API URL as needed
      const data = await apiResponse.json();
      setExercises(data); // Assuming the API response is an array of exercises
      setError(null);
    } catch (error) {
      console.error('Error fetching data:', error);
      setError('Error fetching data from the API.');
    }
  };

  return (
    <div>
      <div className='programs-header'>
        <h1 className='Header'>Or let AI generate it for you</h1>
      </div>
      <button onClick={handleButtonClick}>Generate AI</button>
      {error && <p>Error: {error}</p>}
      {exercises.length > 0 && (
        <div>
          <h2>Generated Exercises:</h2>
          <ul>
            {exercises.map((exercise, index) => (
              <li key={index}>{exercise}</li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default AIGenerate;
